import React from "react";
import { View, StyleSheet, TouchableOpacity, Text, Image, StatusBar } from "react-native";

TouchableOpacity.defaultProps = { activeOpacity: 0.8 };

const AppButton = ({ onPress, title, titleSmall }) => (
  <TouchableOpacity onPress={onPress}
  style={styles.appButtonContainer}>
    <Text style={styles.appButtonText}>{title}</Text>
    <Text style={styles.appButtonTextSmall}>{titleSmall}</Text>
  </TouchableOpacity>
);

const App = () => {
  return (
    <View style={styles.screenContainer}>
      <StatusBar style="auto" />
      <View style={styles.topContainer}>
        <Text style={{color: '#ffffff', fontSize: 20}}>Phone</Text>
      </View>
      <View style={{marginHorizontal: 20}}>
        <Text style={{fontSize:50}}>BLANK</Text>
      </View>
      <View style={{marginTop: '20%'}}>
      <View style={styles.buttonThree}>
      <AppButton title="1"
      titleSmall="O_O"
      backgroundColor="#000000" />
      <AppButton title="2"
      titleSmall="ABC"
      backgroundColor="#007bff" />
      <AppButton title="3"
      titleSmall="DEF"
      backgroundColor="#007bff" />
      </View>
      <View style={styles.buttonThree}>
      <AppButton title="4" size="sm"
      titleSmall="GHI"
      backgroundColor="#007bff" />
      <AppButton title="5" size="sm"
      titleSmall="JKL"
      backgroundColor="#007bff" />
      <AppButton title="6" size="sm"
      titleSmall="MNO"
      backgroundColor="#007bff" />
      </View>
      <View style={styles.buttonThree}>
      <AppButton title="7" size="sm"
      titleSmall="PQRS"
      backgroundColor="#007bff" />
      <AppButton title="8" size="sm"
      titleSmall="TUV"
      backgroundColor="#007bff" />
      <AppButton title="9" size="sm"
      titleSmall="WXYZ"
      backgroundColor="#007bff" />
      </View>
      <View style={styles.buttonThree}>
      <AppButton title="*" size="sm"
      //titleSmall="O_O"
      backgroundColor="#007bff" />
      <AppButton title="0" size="sm"
      titleSmall="+"
      backgroundColor="#007bff" />
      <AppButton title="#" size="sm"
      //titleSmall="DEF"
      backgroundColor="#007bff" />
      </View>
      </View>
      <View style={styles.phoneButton}>
        <TouchableOpacity style={styles.phoneButton} >
          <Image style={styles.imagePhone} source={require("./assets/phone3.png")}/>
        </TouchableOpacity>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  screenContainer: {
    flex: 1,
    //alignContent: "center",
    alignItems: "center",
    //justifyContent: 'flex-end',
    //justifyContent: "center",
    //padding: 16
  },
  topContainer: {
    paddingLeft: 20,
    paddingBottom: 20,
    paddingTop: 10,
    width: '100%',
    backgroundColor: '#35D335',
  },
  imagePhone: {
    marginTop: 20,
    width: 80,
    height: 70,
    //backgroundColor: '#ffffff',
  },
  appButtonContainer: {
    backgroundColor: "#ffffff",
    borderColor: '#000000',
    borderWidth: 1,
    paddingVertical: 2,
    width: '33.35%',
  },
  buttonThree: {
    alignSelf: 'stretch',
    flexDirection: 'row',
  },
  appButtonText: {
    fontSize: 30,
    color: "#000000",
    alignSelf: "center",
    //textTransform: "uppercase"
  },
  appButtonTextSmall: {
    fontSize: 10,
    color: "#5D5F5D",
    //fontWeight: "bold",
    alignSelf: "center",
    textTransform: "uppercase"
  },
  phoneButton: {
    //backgroundColor: '#26E52B'
  }
});

export default App;
